    var myMessage = {};
    myMessage.success = function(title,text) {
       new PNotify({
            title: title,
            text: text,
            type: 'success'
        });
    };
    myMessage.info = function(title,text) {
       new PNotify({
            title: title,
            text: text,
            type: 'info'
        });
    };
    myMessage.error = function(title,text) {
       new PNotify({
            title: title,
            text: text,
            type: 'error'
        });
    };
